import React, { Component } from "react";

class Cart extends Component {
    render() {
        return (
            <div>
                <br />
                <br />
                <div class="ui teal one item inverted menu">
                    <div className="item">
                        <i className="Big Cart Icon">    
                        </i>
                    </div>
                </div>
            </div>
        );
    }
}

export default Cart;
